// ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê
//  DECO PAGE LOGIC ‚Äî v5 (bundle support)
// ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê

const ITEMS_PER_PAGE = 50;
let currentData   = [];
let currentPage   = 1;
let currentFilter = 'all';
let selectedDecoration = null;

// ‚îÄ‚îÄ‚îÄ Image helpers ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function getProxiedImageUrl(url) {
  if (!url) return '';
  if (url.includes('cdn.discordapp.com')) {
    // Lu√¥n th√™m ?passthrough=true cho t·∫•t c·∫£ Discord CDN URLs
    // ƒê·ªÉ Discord tr·∫£ v·ªÅ GIF/video ƒë·ªông thay v√¨ ·∫£nh tƒ©nh (√°p d·ª•ng cho c·∫£ assets/content URLs)
    if (url.includes('?')) {
      return url + '&passthrough=true';
    } else {
      return url + '?passthrough=true';
    }
  }
  return url;
}



function getImageWithFallbacks(decoration) {
  const id = decoration.id;
  const urls = [
    decoration.image,
    ...(decoration.type === 'avatar_decoration' ? [
      `https://cdn.discordapp.com/avatar-decoration-presets/a_${id}.gif?size=240`,
      `https://cdn.discordapp.com/avatar-decoration-presets/${id}.png?size=240`,
    ] : []),
  ].filter(Boolean);
  return urls.map(u => getProxiedImageUrl(u));
}

// ‚îÄ‚îÄ‚îÄ Init ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
document.addEventListener('DOMContentLoaded', () => {
  const el = id => document.getElementById(id);

  const countAvatar = DECORATIONS_DATA.filter(d => d.type === 'avatar_decoration').length;
  const countName   = DECORATIONS_DATA.filter(d => d.type === 'nameplate').length;
  const countFX     = DECORATIONS_DATA.filter(d => d.type === 'profile_effect').length;
  const countAll    = DECORATIONS_DATA.length;

  if (el('count-all'))      el('count-all').textContent      = countAll;

  if (el('count-avatar'))   el('count-avatar').textContent   = countAvatar;
  if (el('count-nameplate'))el('count-nameplate').textContent = countName;
  if (el('count-effect'))   el('count-effect').textContent   = countFX;

  el('sidebar-all')?.classList.add('active');
  applyFilters();
  setupEventListeners();
});

// ‚îÄ‚îÄ‚îÄ Filter & Search ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function applyFilters() {
  const query = (document.getElementById('search-input')?.value || '').toLowerCase().trim();

  let filtered = DECORATIONS_DATA;
  if (currentFilter !== 'all') {
    filtered = filtered.filter(d => d.type === currentFilter);
  }
  if (query) {
    filtered = filtered.filter(d =>
      d.name.toLowerCase().includes(query) || d.id.includes(query)
    );
  }

  currentData = filtered;
  currentPage = 1;

  const totalEl = document.getElementById('total-count');
  if (totalEl) totalEl.textContent = filtered.length;

  renderPage();
  renderPagination();
}

// ‚îÄ‚îÄ‚îÄ Render cards ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function renderPage() {
  const grid = document.getElementById('decorations-grid');
  if (!grid) return;
  grid.style.display = 'grid';

  const start    = (currentPage - 1) * ITEMS_PER_PAGE;
  const pageData = currentData.slice(start, start + ITEMS_PER_PAGE);

  if (currentData.length === 0) {
    grid.innerHTML = `
      <div class="deco-empty">
        <div class="deco-empty-icon"><i class="fas fa-search"></i></div>
        <h3>Kh√¥ng t√¨m th·∫•y decoration n√†o</h3>
        <p>Th·ª≠ t√¨m ki·∫øm v·ªõi t·ª´ kh√≥a kh√°c</p>
      </div>`;
    return;
  }

  grid.innerHTML = pageData.map(deco => {
    const fallbackUrls = getImageWithFallbacks(deco);
    const primaryUrl   = fallbackUrls[0];
    const p            = deco.pricing || {};
    const cur          = p.currency === 'DISCORD_ORB' ? ' Orbs' : ' VNƒê';

    // Type badge
    const badge =
deco.type === 'avatar_decoration' ? '<i class="fas fa-user-circle"></i> Avatar' :
      deco.type === 'nameplate'         ? '<i class="fas fa-id-badge"></i> Nameplate' :
                                          '<i class="fas fa-magic"></i> Profile FX';

    // Pricing
    let pricingHTML = '';
    if (p.regular) {
      if (p.nitro && p.nitro > 0 && p.nitro < p.regular) {
        const disc = Math.round((1 - p.nitro / p.regular) * 100);
        pricingHTML = `<div class="deco-card-pricing">
          <span class="price-regular">${p.regular.toLocaleString()}${cur}</span>
          <span class="price-nitro">${p.nitro.toLocaleString()}${cur}</span>
          <span class="price-badge">-${disc}%</span>
        </div>`;
      } else {
        pricingHTML = `<div class="deco-card-pricing">
          <span class="price-single">${p.regular.toLocaleString()}${cur}</span>
        </div>`;
      }
    }

    const bundleTagsHTML = '';

    const safeUrl  = deco.url.replace(/'/g, '%27');
    const safeName = deco.name.replace(/"/g, '&quot;');

    const fallbacksStr = JSON.stringify(fallbackUrls.slice(1)).replace(/'/g, '&#39;');

    const imageAreaHTML = `<img src="${primaryUrl}" alt="${safeName}"
      data-fallbacks='${fallbacksStr}'
      onerror="tryNextFallback(this)" loading="lazy">`;

    return `
    <div class="deco-card"
          onclick="showDetail('${deco.id}')" data-type="${deco.type}">
      <div class="deco-card-image">
        <span class="deco-type-badge">${badge}</span>
        ${imageAreaHTML}
      </div>
      <div class="deco-card-body">
        <div class="deco-card-title" title="${safeName}">${deco.name}</div>
        ${bundleTagsHTML}
        ${pricingHTML}
        <div class="deco-card-actions">
          <button class="deco-btn deco-btn-primary"
            onclick="event.stopPropagation(); openInDiscordDirect('${safeUrl}')">
            <i class="fas fa-shopping-bag"></i> Mua Ngay
          </button>
          <button class="deco-btn"
            onclick="event.stopPropagation(); copySkuLink('${safeUrl}', this)">
            <i class="fas fa-link"></i> Copy Link
          </button>
        </div>
      </div>
    </div>`;
  }).join('');
}

// ‚îÄ‚îÄ‚îÄ Pagination ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function renderPagination() {
  const container = document.getElementById('deco-pagination');
  if (!container) return;
  const totalPages = Math.ceil(currentData.length / ITEMS_PER_PAGE);
  if (totalPages <= 1) { container.innerHTML = ''; return; }

  let html = `<button class="page-btn" onclick="goToPage(${currentPage - 1})"
    ${currentPage === 1 ? 'disabled' : ''}><i class="fas fa-chevron-left"></i></button>`;

  getPageNumbers(currentPage, totalPages).forEach(p => {
    html += p === '...'
      ? `<span class="page-dots">‚Ä¶</span>`
      : `<button class="page-btn ${p === currentPage ? 'active' : ''}"
           onclick="goToPage(${p})">${p}</button>`;
  });

  html += `<button class="page-btn" onclick="goToPage(${currentPage + 1})"
    ${currentPage === totalPages ? 'disabled' : ''}><i class="fas fa-chevron-right"></i></button>`;

  const start = (currentPage - 1) * ITEMS_PER_PAGE + 1;
  const end   = Math.min(currentPage * ITEMS_PER_PAGE, currentData.length);
  html += `<span class="page-dots" style="margin-left:.5rem;">${start}‚Äì${end} / ${currentData.length}</span>`;

  container.innerHTML = html;
}

function getPageNumbers(current, total) {
  if (total <= 7) return Array.from({ length: total }, (_, i) => i + 1);
  if (current <= 4)          return [1,2,3,4,5,'...',total];
  if (current >= total - 3)  return [1,'...',total-4,total-3,total-2,total-1,total];
  return [1,'...',current-1,current,current+1,'...',total];
}

function goToPage(page) {
  const totalPages = Math.ceil(currentData.length / ITEMS_PER_PAGE);
  if (page < 1 || page > totalPages) return;
  currentPage = page;
  renderPage();
  renderPagination();
  window.scrollTo({ top: 0, behavior: 'smooth' });
}

// ‚îÄ‚îÄ‚îÄ Purchase page / sidebar navigation ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function showPurchasePage() {
  document.getElementById('decorations-grid').style.display   = 'none';
  document.getElementById('deco-pagination').style.display    = 'none';
  document.getElementById('deco-purchase-page').style.display = 'block';
  document.querySelectorAll('.sidebar .category-item').forEach(i => i.classList.remove('active'));
  document.getElementById('sidebar-purchase')?.classList.add('active');
  if (window.innerWidth <= 1024) document.getElementById('deco-sidebar')?.classList.remove('active');
  window.scrollTo({ top: 0, behavior: 'smooth' });
}

function showDecoGrid() {
  document.getElementById('decorations-grid').style.display   = 'grid';
  document.getElementById('deco-pagination').style.display    = 'flex';
  document.getElementById('deco-purchase-page').style.display = 'none';
}

function setDecoFilter(filter) {
  currentFilter = filter;
  showDecoGrid();
  document.querySelectorAll('.sidebar .category-item').forEach(i => i.classList.remove('active'));
  const map = {
    all:               'sidebar-all',

    avatar_decoration: 'sidebar-avatar',
    nameplate:         'sidebar-nameplate',
    profile_effect:    'sidebar-effect',
  };
  document.getElementById(map[filter])?.classList.add('active');
  applyFilters();
  if (window.innerWidth <= 1024) document.getElementById('deco-sidebar')?.classList.remove('active');
}

// ‚îÄ‚îÄ‚îÄ Sidebar / Search toggles ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function toggleDecoSidebar() {
  document.getElementById('deco-sidebar')?.classList.toggle('active');
}

function toggleDecoSearch() {
  const box    = document.getElementById('searchBox');
  const toggle = document.getElementById('searchToggle');
  if (!box) return;
  box.classList.toggle('active');
  toggle?.classList.toggle('active');
  if (box.classList.contains('active'))
    setTimeout(() => box.querySelector('input')?.focus(), 150);
}

document.addEventListener('click', e => {
  const sidebar = document.getElementById('deco-sidebar');
  const menuBtn = document.querySelector('.mobile-menu-btn');
  if (!sidebar || !menuBtn) return;
  if (window.innerWidth <= 1024 &&
      sidebar.classList.contains('active') &&
      !sidebar.contains(e.target) &&
      !menuBtn.contains(e.target)) {
    sidebar.classList.remove('active');
  }
});

function setupEventListeners() {
  document.getElementById('search-input')?.addEventListener('input', applyFilters);
  document.getElementById('detail-modal')?.addEventListener('click', e => {
    if (e.target.classList.contains('modal-overlay')) closeModal();
  });
}

// ‚îÄ‚îÄ‚îÄ Detail Modal ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ
function showDetail(id) {
  selectedDecoration = DECORATIONS_DATA.find(d => d.id === id);
  if (!selectedDecoration) return;

  const deco = selectedDecoration;
  const urls = getImageWithFallbacks(deco);
  const p    = deco.pricing || {};
  const cur  = p.currency === 'DISCORD_ORB' ? ' Orbs' : ' VNƒê';

  const modalImg = document.getElementById('modal-image');
  modalImg.src   = urls[0];
  modalImg.alt   = deco.name;
  modalImg.setAttribute('data-fallbacks', JSON.stringify(urls.slice(1)));
  modalImg.onerror = function() { tryNextFallback(this); };

  document.getElementById('modal-title').textContent = deco.name;

  const typeMap = {
    bundle:            '<i class="fas fa-box-open"></i> Bundle',
    avatar_decoration: '<i class="fas fa-user-circle"></i> Avatar Decoration',
    nameplate:         '<i class="fas fa-id-badge"></i> Nameplate',
    profile_effect:    '<i class="fas fa-magic"></i> Profile Effect',
  };
  document.getElementById('modal-type').innerHTML = typeMap[deco.type] || deco.type;

  // Bundle: show included items
  const modalIdEl = document.getElementById('modal-id');
  if (deco.type === 'bundle' && deco.includedTypes?.length) {
    const tagMap = { Avatar: 'fa-user-circle', Nameplate: 'fa-id-badge', 'Profile FX': 'fa-magic' };
    modalIdEl.innerHTML = `<div class="bundle-includes" style="margin-top:6px;">
      Bao g·ªìm: ${deco.includedTypes.map(t =>
        `<span class="bundle-tag"><i class="fas ${tagMap[t] || 'fa-star'}"></i> ${t}</span>`
      ).join(' ')}
    </div>`;
  } else {
    modalIdEl.textContent = '';
  }

  // Pricing
  const pricingEl = document.getElementById('modal-pricing');
  if (pricingEl && p.regular) {
    if (p.nitro && p.nitro > 0 && p.nitro < p.regular) {
      const disc = Math.round((1 - p.nitro / p.regular) * 100);
      pricingEl.innerHTML = `
        <span class="modal-price-label">Gi√°:</span>
        <span style="text-decoration:line-through;color:var(--text-secondary);margin-right:6px;">
          ${p.regular.toLocaleString()}${cur}</span>
        <span class="modal-price">${p.nitro.toLocaleString()}${cur}</span>
        <span class="price-badge">-${disc}%</span>
        <div style="font-size:.75rem;color:var(--text-secondary);margin-top:4px;">
          <i class="fas fa-gem"></i> Gi√° Nitro</div>`;
    } else {
      pricingEl.innerHTML = `
        <span class="modal-price-label">Gi√°:</span>
        <span class="modal-price">${p.regular.toLocaleString()}${cur}</span>`;
    }
  } else if (pricingEl) { pricingEl.innerHTML = ''; }

  document.getElementById('detail-modal').classList.add('active');
  document.body.style.overflow = 'hidden';
}

function closeModal() {
  document.getElementById('detail-modal')?.classList.remove('active');
  document.body.style.overflow = 'auto';
}

function openInDiscord() {
  if (selectedDecoration) window.open(selectedDecoration.url, '_blank', 'noopener,noreferrer');
}

function openInDiscordDirect(url) {
  window.open(url, '_blank', 'noopener,noreferrer');
}

function copySkuLink(url, btn) {
  navigator.clipboard.writeText(url).then(() => {
    showToast('ƒê√£ copy link!');
    if (btn) {
      const orig = btn.innerHTML;
      btn.innerHTML     = '<i class="fas fa-check"></i> Copied!';
      btn.style.background  = 'var(--primary)';
      btn.style.color       = '#fff';
      btn.style.borderColor = 'var(--primary)';
      setTimeout(() => {
        btn.innerHTML = orig;
        btn.style.background = btn.style.color = btn.style.borderColor = '';
      }, 1500);
    }
  });
}

function copyModalLink() {
  if (selectedDecoration) copySkuLink(selectedDecoration.url, null);
}

function showToast(msg) {
  const toast    = document.getElementById('toast');
  const toastMsg = document.getElementById('toast-message');
  if (!toast) return;
  if (toastMsg) toastMsg.textContent = msg;
  toast.classList.add('show');
  setTimeout(() => toast.classList.remove('show'), 2000);
}

function tryNextFallback(img) {
  try {
    const fallbacks = JSON.parse(img.getAttribute('data-fallbacks') || '[]');
    if (fallbacks.length > 0) {
      const next = fallbacks.shift();
      img.setAttribute('data-fallbacks', JSON.stringify(fallbacks));
      img.src = next;
    } else {
      img.src = 'data:image/svg+xml,%3Csvg xmlns=%22http://www.w3.org/2000/svg%22 width=%22200%22 height=%22200%22%3E%3Crect fill=%22%23111%22 width=%22200%22 height=%22200%22/%3E%3Ctext x=%2250%25%22 y=%2250%25%22 dominant-baseline=%22middle%22 text-anchor=%22middle%22 fill=%22%23666%22 font-size=%2228%22%3Eüé®%3C/text%3E%3C/svg%3E';
    }
  } catch(e) {}
}

document.addEventListener('keydown', e => { if (e.key === 'Escape') closeModal(); });